import { AbsDchooseApi } from "../abstract/AbsDchooseApi";

class SbootDchooseApi extends AbsDchooseApi {
    loadData(params,loading, callback) {
        this.request({
            url: "/chooseService/loadData",
            method: "post",
            data: params,
            loading: loading,
            baseURL: this.modulePath,
            headers: {
                "Content-Type": "application/json"
            }
        }).then(({ data }) => {
            let _data = data.data;
            callback(_data);
        });
    }
}

export { SbootDchooseApi };
